--基础流水表ddl
create table bi_ysfdb.yuanchengwithlabel (
prikey string comment '交易唯一识别号'
, tsdate int comment '本次交易日期yyyymmdd'
, tsyyyymm int comment '本次交易月份 年月'
, tsmon int comment '本次交易月份 [1,12]'
, tsday int comment '本次交易日期 [1,31]'
, tshour int comment '本次交易时间小时 [0,23]'
, tsdayofweek int comment '星期 [0,6]'
, timestamp_s bigint comment '本次交易unix 时间戳，单位为秒'
, transamt double comment '本次交易金额'
, outbankcard string comment '本次转出卡'
, inbankcard string comment '本次转入卡'
, inbankcardattr string comment '转入卡性质'
, usrid string comment '本转出用户id'
, usrgender string comment '本次转出用户性别'
, usrage int comment '本次转出用户年龄'
, hisrownumber int comment '第几笔历史交易'
, hisusrgender string comment '历史转出用户性别'
, hisusrage int comment '历史转出用户年龄'
, hisusrid string comment '历史转出用户id'
, histransamt double comment '历史交易金额'
, histimestamp_s bigint comment '历史交易uninx 时间戳'
, histsdate int comment '历史交易日期yyyymmdd'
, hisoutbankcard string comment '历史交易付款卡'
, hisinbankcard string comment '历史交易收款卡'
, hisoutbankcardregdays string comment '历史交易付款卡注册天数'
, tsdaydiff_win1 int comment '历史交易相对时间，天'
, tssecdiff_win1 int comment '历史交易相对时间，秒'
)
comment '远程转账交易自相交表'
row format delimited fields terminated by ','
stored as textfile
location
'hdfs://master:9000/user/hive/warehouse/mydatabase.db/yuanchengwithlabel'
;



